import React from "react"
import { Link } from "react-router-dom/cjs/react-router-dom"



export default function Landing(){
    return (
    <div className="page">
        <img className="img" src="https://img.freepik.com/free-photo/group-portrait-adorable-puppies_53876-64778.jpg?w=2000" alt=""/>
        <Link to='/dogs'>
            <button className="button">Henry Dogs</button>
        </Link>
    </div>
    )
}
